import styles from "./Tag.module.css";
import { useDispatch } from "react-redux";
export default function Tag({ category }) {
  const filterSuggestions = (category) => {
    console.log("Filter: " + category);
    dispatch(
      sortSuggestions({
        category: category,
      })
    );
  };

  return (
    <button className={styles.tag} onClick={() => filterSuggestions(category)}>
      {category}
    </button>
  );
}
